import React from 'react';
import { InputForm } from '../../Component';
import { styContainer ,sty} from './styles';

const InventoryForm = () => {
  return (
    <div className={styContainer}>
      <div className={styTitle}>Update Inventory</div>
      <div>
        <InputForm />
        <InputForm />
        <InputForm />
      </div>
    </div>
  );
};

export default InventoryForm;
